(1, 'Conception UX/UI ', 'Explorez les principes de conception centrés sur l\'utilisateur pour améliorer l\'expérience utilisateur (UX) et l\'interface utilisateur (UI) des applications web', '2024-03-04 15:44:23', NULL),
(2, 'Optimisation des performances', 'Découvrez les meilleures pratiques pour optimiser les performances des sites web, y compris la réduction du temps de chargement, la minimisation des requêtes HTTP et l\'optimisation des ressources', '2024-03-04 15:45:03', NULL),
(3, 'Gestion des vulnérabilités', 'Explorez les méthodes pour identifier, évaluer et gérer les vulnérabilités de sécurité dans les systèmes informatiques afin de renforcer leur résilience face aux menaces.', '2024-03-04 15:47:15', NULL),
(4, 'Tests d\'intrusion', 'Apprenez les techniques de test d\'intrusion pour évaluer la sécurité d\'un système en simulant des attaques ciblées et en identifiant les vulnérabilités.', '2024-03-04 15:47:49', NULL),
(5, 'Traitement du langage Naturel (NLP)', 'Explorez les méthodes et les algorithmes utilisés pour comprendre et générer un langage naturel par les machines, ouvrant ainsi la voie à des applications telles que la traduction automatique et l\'analyse des sentiments.', '2024-03-04 15:49:13', NULL),
(6, 'Apprentissage profond', 'Plongez dans les techniques d\'apprentissage automatique profond pour créer des modèles d\'IA sophistiqués capables de résoudre des problèmes complexes.', '2024-03-04 15:50:00', NULL),
(7, 'Gestion de l\'état de l\'application', 'Apprenez à gérer efficacement l\'état des applications mobiles, y compris la gestion des données locales, la synchronisation avec des serveurs distants et la gestion des états de connexion.', '2024-03-04 15:51:29', NULL),
(8, 'Interfaces utilisateur réactives', 'Découvrez les principes de conception et de développement pour créer des interfaces utilisateur réactives et interactives qui offrent une expérience fluide sur différentes plateformes mobiles.', '2024-03-04 15:52:29', NULL);

